CREATE TABLE agences-guadeloupe(
   NOM     VARCHAR(23) NOT NULL PRIMARY KEY
  ,ADDRESS VARCHAR(45)
  ,ADRESS2 VARCHAR(26)
  ,CPO     INTEGER 
  ,CITY    VARCHAR(20)
  ,PHONE1  VARCHAR(15)
  ,PHONE2  VARCHAR(15)
  ,EMAIL   VARCHAR(32)
  ,URL     VARCHAR(38)
  ,TYPE    VARCHAR(9) NOT NULL
);
